{'pk': 17895187516651770, 'user_id': 7379695206, 'text': 'Dicen que tuve un bebé 
De @natalia.saralegui.ferrante
@gloria.orregoh
@marucarrer 

Yamila tuvo un aborto espontáneo en el baño de su casa. Fue condenada a nueve años de prisión. Paloma, violada en un barrio de San Fernando, tuvo a su bebé en el baño de la casa de sus tíos y lo creyó muerto. La condenaron a seis años y ocho meses de prisión. Gimena está presa en una cárcel de Salta, cumpliendo diez años después de haber dado a luz en una letrina. Eliana está detenida en San Juan, con una condena de prisión perpetua tras haber quedado embarazada producto de una violación y haber tenido el parto en el fondo de su casa. Inés fue condenada a ocho años por un hecho similar. También Rosalía, que hoy cumple prisión domiciliaria. Patricia, condenada por el “homicidio” de su bebé prematuro, murió en la cárcel. \xa0 Este libro toma los casos de estas siete mujeres para sacar a la luz una realidad silenciada: en la Argentina también hay mujeres perseguidas penalmente y privadas de su libertad tras haber atravesado abortos espontáneos, partos prematuros o en los que los bebés nacieron sin vida. No es algo que sucede solo en otros países. Y a pocas personas les importa. Mientras la pelea por la legalización del aborto continúa, es hora de que estas historias, y tantas como ellas que permanecen invisibles, sean una causa más en las agendas feministas y de la sociedad toda, para que nunca más un embarazo, su interrupción o un parto sean considerados un delito. \xa0 La clave para entender por qué eso sigue sucediendo está en un sistema penal que se ensaña con particular violencia contra estas mujeres. Empieza por caratular sus causas con delitos inexistentes en el Código Penal, como “aborto seguido de homicidio”, “aborto espontáneo” u “homicidio contra bebé varón”, y sigue con maltratos en el hospital, la comisaría y la prisión, prejuicios sobre su falta de “instinto maternal”, pericias psicológicas y pruebas exculpatorias que los tribunales no consideran, testimonios que no escuchan, violaciones que se pasan por alto como si no hubieran existido, beneficios en la cárcel que se les niegan.', 'type': 1, 'created_at': 1603725864, 'created_at_utc': 1603725864, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 7379695206, 'username': 'sigloxxiarg', 'full_name': 'Siglo XXI Editores Argentina', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/36085205_199268900792372_6986203471644983296_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=Z9vqpjVm6BAAX_6qlix&oh=30421e2f95c554731925e0b1acdfdc76&oe=5FD0F616', 'profile_pic_id': '1815399126743761504_7379695206', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604793379, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2428529815578637194, 'has_translation': True, 'private_reply_status': 0}

{'pk': 17858171828225052, 'user_id': 7379695206, 'text': 'Homo academicus de Pierre Bourdieu 
Siglo Veintiuno Editores publica por primera vez en castellano esta obra en la cual Pierre Bourdieu detiene su lúcida mirada en el mundo universitario para señalar y describir la lucha de poderes constante en el campo académico. Para el autor, esta lucha se desarrolla siguiendo una lógica específica, donde el poder académico y el prestigio intelectual ó científico son los dos polos opuestos, mientras que las disciplinas y las prácticas dominantes y dominadas se distribuyen en torno a ellos. ¿Cómo se manifiesta este juego de fuerzas e intereses? Según Bourdieu, esto ocurre en los conflictos entre facultades o entre disciplinas; en las pujas por lograr horarios de clases, recursos económicos y humanos; en la reproducción del cuerpo docente, en la endogamia de ese cuerpo y en sus modos de reclutamiento y selección; y en la exclusión de los adversarios. Es una ilusión pensar que la producción intelectual está exenta de determinismos o que surge del ejercicio libre e independiente del pensamiento, sostiene Bourdieu. Por el contrario, asegura que esa producción está condicionada por la ubicación y la trayectoria en el espacio académico, y quienes se consagran al saber (los que lo construyen y lo transmiten, pero también los estudiantes) no deberían soslayar esta evidencia.

