{'pk': 17885904826723437, 'user_id': 7379695206, 'text': 'La Gendarmería desde adentro de Sabina Frederic

En las primeras décadas de la democracia, Gendarmería era sinónimo de Centinelas de la Patria. Sus efectivos estaban habituados a los pueblos de frontera y a los operativos en la montaña, la selva, la puna. En el curso del siglo XXI, un porcentaje cada vez mayor fue destinado a las zonas más calientes del Conurbano bonaerense y las ciudades de Buenos Aires y Rosario, donde pasaron a convivir con poblaciones en situación de pobreza, hacinamiento, exclusión. Y a prestar servicio en condiciones tan precarias como exigentes. Ni la política ni la sociedad tomaron nota de las consecuencias de semejante mutación. Tal vez por eso, buena parte del arco progresista interpretó los hechos de violencia que protagonizó la fuerza en años recientes desde la memoria traumática del terrorismo de Estado, antes que desde aquello que había ocurrido con los y las gendarmes en los quince años previos. El miedo y la sospecha impidieron preguntarse por las condiciones que habían contribuido a desencadenarlos. Sostenido en una investigación de muchos años, este libro ayuda a entender la dimensión del problema y hasta qué punto excede la cuestión de la seguridad. Después de deambular entre gendarmes, habitar sus aulas y patrulleros, y entrevistar a efectivos de diverso rango, Sabina Frederic reconstruye el accionar cotidiano de la Gendarmería, una fuerza que creció exponencialmente para absorber tareas policiales. Muestra cómo operan los destacamentos móviles antidisturbios o las unidades de policía de proximidad en las villas.\xa0

