{'pk': 17922181345394627, 'user_id': 7379695206, 'text': 'Antología de José Carlos Mariátegui a cargo de Martín Bergel 
Llamado el “primer marxista de América”, periodista, militante e intelectual, José Carlos Mariátegui tuvo una vida breve y fulgurante: nació en 1894 en Moquegua, Perú, y murió en 1930. Su obra, compuesta por cuatro libros ya clásicos y miles de artículos escritos al ritmo vertiginoso de la prensa, sorprende todavía hoy por la capacidad para captar la singularidad de una época que parecía romper violentamente con el pasado y exigía pensar todo de nuevo. Curioso hasta la voracidad, dueño de un estilo “un poco periodístico y un poco cinematográfico”, Mariátegui buscaba entender una Europa convulsionada por la primera guerra mundial y la Revolución Rusa, las vanguardias artísticas y el ascenso del fascismo, al tiempo que se comprometía activamente en la construcción de una alternativa socialista que reconociera el protagonismo de las masas indígenas del Perú.

En un formidable esfuerzo de selección, Martín Bergel propone una sugestiva clave de lectura de un corpus que parece inabarcable: a contrapelo de una interpretación de Mariátegui que lo asimila a una tradición “nacional-popular”, esta Antología recupera la riqueza de un pensamiento tan tensionado por su voluntad de marxismo para encauzar los problemas peruanos como por la inquietud cosmopolita y el internacionalismo.', 'type': 1, 'created_at': 1588951344, 'created_at_utc': 1588951344, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 7379695206, 'username': 'sigloxxiarg', 'full_name': 'Siglo XXI Editores Argentina', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/36085205_199268900792372_6986203471644983296_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=Z9vqpjVm6BAAX_6qlix&oh=30421e2f95c554731925e0b1acdfdc76&oe=5FD0F616', 'profile_pic_id': '1815399126743761504_7379695206', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604793379, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2304613360982984828, 'has_translation': True, 'private_reply_status': 0}

