{'pk': 17844117115464371, 'user_id': 7379695206, 'text': 'El nuevo libro de Mario Wainfeld, Estallidos argentinos. Cuando se desbarata el vago orden en que vivimos. ¿Por qué, cada cierto tiempo, los argentinos volvemos a sentir que estamos al borde del estallido, que la sociedad no aguanta más y todo puede volar por el aire? ¿Somos un desastre? ¿No tenemos remedio? Mario Wainfeld nos ayuda a entender cómo hacemos política en la Argentina y cómo somos como sociedad.

A partir de diez crónicas deslumbrantes de episodios del pasado reciente, este libro lucha contra la amnesia política, rescatando acontecimientos clave en que la sociedad salió a la calle para expresarse y dar vuelta la historia ((desde los casos más resonantes de la represión de la era macrista hasta la breve presidencia de Rodríguez Saá, pasando por el asesinato del Gobernador Carlos Soria y la fallida decisión del 2x1 de la Corte). Y nos cuenta además las trastiendas escondidas del poder: los ataques de pánico, la ceguera, los errores y los trucos de los gobernantes.

En la vorágine intensa que es la política argentina, Mario Wainfeld rescata estos casos para ayudarnos a comprender nuestro presente, cómo funciona la política y todo lo que puede la movilización colectiva.', 'type': 1, 'created_at': 1559153030, 'created_at_utc': 1559153030, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 7379695206, 'username': 'sigloxxiarg', 'full_name': 'Siglo XXI Editores Argentina', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/36085205_199268900792372_6986203471644983296_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=Z9vqpjVm6BAAX_6qlix&oh=30421e2f95c554731925e0b1acdfdc76&oe=5FD0F616', 'profile_pic_id': '1815399126743761504_7379695206', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2054636811511555778, 'has_translation': True, 'private_reply_status': 0}

